// Navbar.js

import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar = () => {
  return (
    <ul className="nav nav-tabs" id="myTab" role="tablist">
      <li className="nav-item" role="presentation">
        <NavLink to="/" className="nav-link" activeClassName="active" exact>Rooms</NavLink>
      </li>
      <li className="nav-item" role="presentation">
        <NavLink to="/se" className="nav-link" activeClassName="active">Scenes</NavLink>
      </li>
      <li className="nav-item" role="presentation">
        <NavLink to="/aboutMe" className="nav-link" activeClassName="active">About Me</NavLink>
      </li>
    </ul>
  );
};

export default Navbar;
